import { StyleSheet, Text, View, SafeAreaView, Button, Dimensions, ImageBackground, Image} from 'react-native';

const { width, height } = Dimensions.get('window');

const JoueurScreen = (props) => {
  return(
  <SafeAreaView style={styles.container}>
    <View style = {styles.Header}>
        <View style = {styles.BlockTextAccueil}>
          <Text style = {styles.TextAccueil}>Accueil</Text>
        </View>
    </View>
    <View style={styles.pageContenu}>

    </View>

  </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex:1,
    backgroundColor:'#013E23',
    padding: 10,
    paddingBottom:80,
  },

  Header: {

  },

 BlockTextAccueil: {
  alignItems:'center',
  marginTop:40,
  },

  TextAccueil:{
    fontFamily: 'SFMedium',
    fontSize:20,
    color:'lightgrey'
  },

  pageContenu:{
    backgroundColor:'white',
    width:'100%',
    height:'100%',
    borderRadius:10,
  }
})

export default JoueurScreen;
